I get point:

+ the number of cores = the number of computer unit;
+ cycle = an unit pipeline in GPU to implement operations;
+ operation per cycle per tensor: how many cycles one cycle can operate at the same time;
+ clock speed is the frequency that one core can complete a cycle.

It's noteworthy that the clock speed is independent with the operation per cycle per tensor, the former measures the rate of a cycle (pipeline), and the latter measures the parallel power. Thus one core can compute clock_speed * operation_per cycle_per_tensor times cycles.

